import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import { Login } from "./Login";
import { Chatbot } from "./Chatbot";

const App = () => {
  return (
    <Router>
      <nav>

      </nav>
        <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Chatbot />} />
        </Routes>
    </Router>
  );
};

export default App;
